import react from 'react';  
import './Header_style/Header.css'; 
import logo from './image/logo.png';  

const Header = () => {
  return (
	  <>

	  <header className="header">
        <img src={logo} alt="logo image" />
      </header>
	  </>
  );
} 

export default Header;
